import RecomItem from "./RecomItem";
import "./RecomList.css";
const RecomList = (props) => {
  return (
    <ul className="recom-list-container">
      {props.item.map((item) => (
        <RecomItem
          key={item.key}
          icon={item.icon}
          label={item.label}
          category={item.category}
        />
      ))}
      ;
    </ul>
  );
};

export default RecomList;
